import React from 'react';
import { BrowserRouter,Routes, Route } from 'react-router-dom'; 
import Join from './components/Join';
import Chat from './components/Chat';
const App =()=>{
    return(
        <BrowserRouter>
        <Router>
            <Route path="/"  element={<Join/>}/>
            <Route path="/chat"  element={<Chat/>}/>
        </Router>
        </BrowserRouter>
    )
}

export default App;
